description:
The Mamas &amp; The Papas - California Dreamin' [Ed Sullivan 1968].VOB



HQ rare &quot;Ed Sullivan&quot; show music video. &quot;California Dreamin'&quot; is a popular 
song by The Mamas &amp; The Papas, first released in 1965. The song is #89 in 
Rolling Stone's list of The 500 Greatest Songs of All Time. The lyrics 
of the song are about a man in a cold winter landscape longing for the 
warmth of California. (video does not have any logos)


